import 'dart:convert';
import 'dart:typed_data';
import 'package:flutter/material.dart';

class UpgradePremiumScreen extends StatelessWidget {

  const UpgradePremiumScreen({super.key});
  final String qrDataUrl='data:image/png;base64,';

  @override
  Widget build(BuildContext context) {
    final base64Str = qrDataUrl.split(',').last;
    final Uint8List qrBytes = base64Decode(base64Str);

    return Scaffold(
      backgroundColor: const Color(0xFF2C3E50),
      appBar: AppBar(
        backgroundColor: const Color(0xFF2C3E50),
        title: const Text('Premium package'
            , style: TextStyle(color: Colors.white)),
      ),
      body: Center(
        child: qrBytes.isNotEmpty
            ? Image.memory(
          qrBytes,
          width: 550,
          height: 550,
          fit: BoxFit.contain,
        )
            : const Text('Không có mã QR để hiển thị'),
      ),
    );
  }
}
